*
 * 打开客户端用户偏好页面
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<Object>}
 *
 * @example
 * libSQ.exec('navigation-preference-set', {
 *    params: {},
 *  }).then((info) => {
 *    console.log(`[navigation-preference-set][then] ${JSON.stringify(info, null, 2)}`);
 *  }).catch((err) => {
 *    alert(`[navigation-preference-set][error] ${JSON.stringify(err, null, 2)}`);
 *  });

